import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Navbar from './components/Navbar/Navbar';
import Hero from './components/Hero/Hero';
import StudentSection from './components/StudentSection/StudentSection';
import Schedule from './components/Schedule/Schedule';
import Contact from './components/Contact/Contact';
import Footer from './components/Footer/Footer';

// Component riêng cho trang chủ
const Home = () => {
  return (
    <>
      <Hero />
      <StudentSection />
    </>
  );
};

function App() {
  return (
    <Router>
      <div className="app">
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} /> {/* Route cho trang chủ */}
          <Route path="./components/Schedule/Schedule" element={<Schedule />} /> {/* Route cho trang lịch học */}
          <Route path="./components/Contact/Contact" element={<Contact />} /> {/* Route cho trang liên hệ */}
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
